let isInitialized=!1;const addCollapsibleCallouts=()=>{if(isInitialized){console.log("Collapsible Callouts already added!");return}const e=document.querySelectorAll("blockquote.callout-collapsible");e.length!=0&&(console.log("Adding Collapsible Callouts"),e.forEach(e=>e.addEventListener("click",e=>{console.log("register collapsible callout event"),e.currentTarget.classList.toggle("callout-collapsed")})),isInitialized=!0)}